import "./Header.css"

function Header(){
  return(
    <header>
      <div>
        <i className="fa-solid fa-bars"></i>
        <img src="./textLogo.png" width="3%" />
      </div>
      <div>로그인</div>
    </header>
  )
}
export default Header;
